function solve (password) {
    let passArr = password.split('');
    let passValid = true;

    if (passArr.length < 6 || passArr.length > 10) {
        console.log("Password must be between 6 and 10 characters");
        passValid = false;
    }

    function isAlphanumeric(str) {
        return /^[a-zA-Z0-9]+$/.test(str);
    }

    if (!isAlphanumeric(password)) {
        console.log("Password must consist only of letters and digits");
        passValid = false;
    }

    function hasTwoDigits(str) {
        return (str.match(/[0-9]/g) || []).length >= 2;

    }

    if(!hasTwoDigits(password)) {
        console.log("Password must have at least 2 digits");
        passValid = false;
    }

    if (passValid) {
        console.log("Password is valid")
    }
}

function solve(num1, num2) {
    function factorial(num) {
        return (num > 1) ? factorial(num - 1) * num : 1;
    }

    console.log((factorial(num1) / factorial(num2)).toFixed(2));
}

#include <Arduino.h>
#include <WiFiManager.h>
#include <HTTPClient.h>

#define BUTTONPIN 23
#define DEBOUNCEMS 15

String toggleURL = "http://led.web.lan/toggleleds.php?state=";
unsigned short buttonState = HIGH, lastButtonState = HIGH;

void sendToggleMessage(bool state) {
  char webMsg[255] = "";
  strcat(webMsg, toggleURL.c_str());
  strcat(webMsg, (state) ? "true" : "false");
  HTTPClient http;
  http.begin(webMsg);
  http.GET();
  http.end();
}

void setup() {
  Serial.begin(115200);
  pinMode(BUTTONPIN, INPUT_PULLUP);
  Serial.println("MAC Address: " + WiFi.macAddress());
  WiFiManager wifiManager;
  wifiManager.autoConnect("ToggleLEDs");
}

unsigned long lastDebounceTime = 0;
bool toggleState = false;
bool debouncing = false;
void loop() {
  unsigned short buttonCheck = digitalRead(BUTTONPIN);
  if ( buttonCheck != lastButtonState ) {
    debouncing = true;
    lastDebounceTime = millis();
  }
  if ( debouncing && (millis() >= (lastDebounceTime + DEBOUNCEMS)) ) {
    debouncing = false;
    if ( buttonCheck != buttonState ) {
      buttonState = buttonCheck;
      if ( buttonState == LOW ) {
        toggleState = !toggleState;
        sendToggleMessage(toggleState);
      }
    }
  }
  lastButtonState = buttonCheck;
}

